  constructor() { }

  ngAfterViewInit() {
    console.log(this.seq)

    this.seq.forEach(d => {
      d['aa'] = d.data.AAsequence.split("");
    })


    let nested = d3.nest()
      .key((d: any) => d.outcome)
      .rollup(function(values: any): any {
        return {
          total: values.length,
          aa: values.map(d => d.aa)
        }
      })
      .entries(this.seq);

    nested.forEach((d: any) => {
      d['aa_t'] = d['value'].aa[0].map((_, i) => d['value'].aa.map(row => row[i]));
    })

    nested.forEach((d: any) => {
      d['aa_freq'] = d.aa_t.map(function(location: any, idx: number): any {
        let freq: any = d3.nest()
          .key((x: any) => x)
          .rollup((values: any) => values.length)
          .entries(location).sort((a: any, b: any) => b.value - a.value);

        return {
          aa: freq,
          mode: freq[0]['key'],
          i: idx,
          pct_conserved: (freq[0]['value']) / d['value']['total'],
          cohort: d.key
        }
      })
      // .sort((a,b) => a.value - b.value);
    }
    )

    //   nested.forEach((d: any) => {
    //   d['aa_freq'] = d.aa_t.map(location => d3.nest().key((x: any) => x).rollup((values: any) => values.length).entries(location)).sort((a,b) => a.value - b.value);
    // })
    let aa_freq = flatMapDeep(nested, (d: any) => d.aa_freq);

    console.log(aa_freq)

    let aa_match = d3.nest()
      .key(d => d["i"])
      .rollup(function(values: any) { // do this to each grouping
        // reduce takes a list and returns one value
        // in this case, the list is all the grouped elements
        // and the final value is an object with keys
        return values.reduce(function(prev, curr) {
          prev[curr["modes"]] ? prev[curr["modes"]].push(curr["mode"]) : prev[curr["modes"]] = [curr["mode"]];
          return prev;
        }, {});
      })
      .entries(aa_freq);

    console.log(nested)
    console.log(aa_match)


    let aa_match2 = aa_match.map((d: any) => Array.from(new Set(d.value.undefined)).length);

    console.log(aa_match2)

    let idx_mutations = aa_match2.reduce(function(prev, curr, i) {
      if (curr > 1) {
        prev.push(i);
      }
      return (prev);
    }, [])

    console.log(idx_mutations)



    let filtered = aa_freq.filter(d => idx_mutations.includes(d.i));
    this.data = filtered;
    console.log(filtered.sort((a,b) => a.i - b.i))

    // let nested_filtered = d3.nest()
    // .key(d => d["i"])
    // .rollup(function(values: any): any {
    //   return {
    //     total: values.length,
    //     data: values,
    //     i: values.map((x) => x.i),
    //     mode: values.map((x) => x.mode),
    //     pct_conserved: values.map((x) => x.mode),
    //   }
    // })
    //   .entries(aa_freq);
    //
    //
    //
    // console.log(nested_filtered)

    this.drawChart();
  }

  drawChart() {
    this.element = this.chartContainer.nativeElement;

    let svg = d3.select(this.element)
      .append('svg')
      .attr("class", "barplot")
      .attr("width", this.width + this.margin.left + this.margin.right)
      .attr("height", this.height + this.margin.top + this.margin.bottom)

      this.chart = svg.append("g").attr("id", "rect_group")
      .attr("transform", `translate(${this.margin.left}, ${this.margin.top})`);

    this.x = d3.scaleBand()
      .rangeRound([0, this.width])
      .paddingInner(0.05)
      .paddingOuter(0)
      .domain(this.data.map((d) => d.i));

    this.y = d3.scaleBand()
      .rangeRound([0, this.height])
      .paddingInner(this.spacing)
      .paddingOuter(0)
      .domain(this.data.map(d => d.cohort));

    this.xAxis = d3.axisTop(this.x);
    this.yAxis = d3.axisLeft(this.y);

    this.colorScale = d3.scaleSequential(d3.interpolateGreys)
      .domain([0, 1]);


    this.AAColorScale = d3.scaleOrdinal(
      [this.aliphatic, this.aliphatic, this.aliphatic, this.aliphatic, this.aliphatic, this.aliphatic, this.aromatic, this.aromatic, this.aromatic, this.acidic, this.acidic, this.basic, this.basic, this.basic, this.hydroxy, this.hydroxy, this.thiol, this.thiol, this.amide, this.amide])
      .domain(["A", "G", "I", "L", "P", "V",
      "F", "W", "Y", "D", "E", "R", "K", "H", "S", "T", "C", "M", "N", "Q"]);

    let rect_data = this.chart
      .selectAll(".seq-rect")
      .data(this.data);

    rect_data.enter().append("rect")
      .attr("x", (d:any) => this.x(d.i))
      .attr("y", (d: any) => this.y(d.cohort))
      .attr("class", "seq-rect")
      .attr("id", (d:any, i) => `${d.cohort}${i}`)
      .attr("fill", (d:any) => this.colorScale(d.pct_conserved))
      .attr("width", this.x.bandwidth())
      .attr("height", this.y.bandwidth());

    rect_data.enter().append("text")
      .attr("x", (d:any) => this.x(d.i) + this.x.bandwidth() / 2)
      .style("font-size", d3.min([this.x.bandwidth() * 0.8, this.y.bandwidth() * 0.8]))
      .attr("y", (d:any) => this.y(d.cohort) + this.y.bandwidth() / 2)
      .attr("fill", (d:any) => this.AAColorScale(d.mode))
      .attr("class", "seq-label")
      .text((d: any) => d.mode)

    svg.append('g')
      .attr('class', 'axis axis--y')
      .attr('transform', `translate(${this.margin.left}, ${this.margin.top})`)
      .call(this.yAxis);

    svg.append('g')
      .attr('class', 'axis axis--x')
      .attr('transform', `translate(${this.margin.left}, ${this.margin.top})`)
      .call(this.xAxis);

  }



